 function dodajWiersz(){
            var number = document.getElementById("ileWierszy").value;
            var container = document.getElementById("wierszTabeli");
            while (container.hasChildNodes()) {
                container.removeChild(container.lastChild);
            }
            for (i=0;i<number;i++){
                 container.appendChild(document.createTextNode("W" + (i+1)));
                for (j=0;j<5;j++){
                    var input = document.createElement("input");
                    input.id = 'tab' + i + j;
                    input.className = "komorkaTabeli inputPole";
                    input.type = "text";
                    container.appendChild(input);
                }
                container.appendChild(document.createElement("br"));
            }
}

/* TABELA */

function buildTableBody(data, columns) {
    var body = [];

    body.push(columns);

    data.forEach(function(row) {
        var dataRow = [];

        columns.forEach(function(column) {
            dataRow.push(row[column].toString());
        })

        body.push(dataRow);
    });

    return body;
}

function table(data, columns) {
    return {
        table: {
            headerRows: 0,
            widths: [110, 120, 145, 30, 65],
            body: buildTableBody(data, columns)
        }
    };
}

